import React from "react";
import s from "./Login.module.css"
const LoginForm =()=>{
    return(
        <div className={s.form}>
            <form action="">
                <div><input type="text"/></div>
                <div><input type="text"/></div>
                <div><button>Logged in</button></div>
            </form>
        </div>
    )
}
export default LoginForm;
